import './App.css';
import { useEffect } from 'react';

function App() {
  useEffect(()=> {
     fetch("http://localhost:8082/api/v1/employees",{method:"GET"})
     .then((resp)=>resp.json)
     .then((employeeItem)=> {
      if(employeeItem) {
             console.log("alo dc");
      }
    //  console.log("employee alo  : " +employeeItem);
     });
  });
  return (
    <div className="App">
      hello moi nguoi mionh la sinh di code dao
    </div>
  );
}

export default App;
